targetA = {
  let target = DOM.element('div')
  return target
}
targetB = {
  let target = DOM.element('div')
  return target
}
joinTargets = {
  let a = functionPlot({
    target: targetA,
    xAxis: { domain: [-6, 6] },
    yAxis: { domain: [-6, 6] },
    annotations: [
      {
        y: 1,
        text: 'max'
      },
      {
        y: -1,
        text: 'min'
      }
    ],
    data: [
      {
        // fn: '(x^3) / 3 - 2 * x * x + 3 * x + 2',
        fn: 'sin(x)',
        graphType: 'polyline',
        derivative: {
          // fn: '2 * x * x - 4 * x + 3',
          fn: 'cos(x)',
          updateOnMouseMove: true
        }
      }
    ]
  })
  let b = functionPlot({
    target: targetB,
    xAxis: { domain: [-4, 8] },
    yAxis: { domain: [-4, 8] },
    annotations: [
      {
        x: 1,
        text: 'intercept'
      },
      {
        x: 3,
        text: 'intercept'
      }
    ],
    data: [
      {
        fn: 'x * x - 4 * x + 3',
        graphType: 'polyline'
      }
    ]
  })
  a.addLink(b)
  b.addLink(a)
  return "targets joined!"
}
